#include <iostream>
#include <string>
#include <unordered_set>
#include <vector>
#include <algorithm>
using namespace std;

long long hashx[1005], hashy[1005];
long long powmod[1005];
const long long mod = 2147483647;
const long long base = 373;
int pref[1005];
int pref1[1005];
int main() {
    string x, y;
    cin >> x >> y;
    int n = x.size();
    int m = y.size();
    x = " " + x;
    y = " " + y;

    powmod[0] = 1;
    for (int i = 1; i <= max(n, m); i++) {
        powmod[i] = (powmod[i - 1] * base) % mod;
    }

    for (int i = 1; i <= n; i++) {
        hashx[i] = (hashx[i - 1] * base + x[i]) % mod;
    }
    for (int i = 1; i <= m; i++) {
        hashy[i] = (hashy[i - 1] * base + y[i]) % mod;
    }

    for (int i = 1; i <= n; i++) {
        pref[i] = pref[i - 1] + (isdigit(x[i]));
    }
    for (int i = 1; i <= m; i++) {
        pref1[i] = pref1[i - 1] + (isdigit(y[i]));
    }
    unordered_set<long long> hashs;
    for (int i = 1; i <= n; i++) {
        if(x[i] == '0') continue;
        for (int j = i; j <= n; j++) {
            if (pref[j] - pref[i - 1] == (j - i + 1)) {
                long long hash_val = (hashx[j] - (hashx[i - 1] * powmod[j - i + 1]) % mod + mod) % mod;
                hashs.insert(hash_val);
                debug(x.substr(i, j - i + 1));
            }
        }
    }

    int maxlen = 0;
    vector<string> nums;
    for (int i = 1; i <= m; i++) {
        for (int j = i; j <= m; j++) {
            if (pref1[j] - pref1[i - 1] != (j - i + 1)) continue;
            long long hash_val = (hashy[j] - (hashy[i - 1] * powmod[j - i + 1]) % mod + mod) % mod;
            if (hashs.find(hash_val) != hashs.end()) {
                int len = j - i + 1;
                string num = y.substr(i, len); 
                if (len > maxlen) {
                    maxlen = len;
                    nums = {num};
                } else if (len == maxlen) {
                    nums.push_back(num);
                }
            }
        }
    }

    if (nums.empty()) {
        cout << "-1\n";
    } else {
        sort(nums.begin(), nums.end());
        cout << nums.back() << endl; 
    }

    return 0;
}